import React, { useState } from "react";
import { Routes, Route, useNavigate, useLocation } from "react-router-dom";
import Home from "./components/Home";
import SignIn from "./components/SignIn";
import ContactUS from "./components/Contact";
import About from "./components/AboutUs";

import {
  AppBar,
  Toolbar,
  Button,
  Box,
  Typography,
  Container,
} from "@mui/material";
import { Home as HomeIcon, Info, Login } from "@mui/icons-material";
import "./App.css";

function AppLayout() {
  const [showAbout, setShowAbout] = useState(false);
  const navigate = useNavigate();
  const location = useLocation();

  return (
    <div className="app-container">
      {/* Navigation Bar */}
      <AppBar
        position="fixed"
        sx={{ backgroundColor: "white", boxShadow: "none" }}
      >
        <Container maxWidth="lg">
          <Toolbar sx={{ justifyContent: "flex-end" }}>
            <Box sx={{ display: "flex", gap: 2 }}>
              <Button
                onClick={() => navigate("/")}
                startIcon={<HomeIcon />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": { color: "#e95d4d" },
                }}
              >
                Home
              </Button>
              <Button
                onClick={() => navigate("/signin")}
                startIcon={<Login />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": { color: "#e95d4d" },
                }}
              >
                Sign In
              </Button>
              <Button
                onClick={() => navigate("/contactus")}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": { color: "#e95d4d" },
                }}
              >
                Contact Us
              </Button>
              <Button
                onClick={() => {
                  setShowAbout(!showAbout);
                  navigate("/aboutus");
                }}
                startIcon={<Info />}
                sx={{
                  color: "#537955",
                  backgroundColor: "transparent",
                  "&:hover": { color: "#e95d4d" },
                }}
              >
                About Us
              </Button>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>

      {/* About Panel */}
      {showAbout && location.pathname === "/aboutus" && (
        <Box
          sx={{
            position: "fixed",
            top: "80px",
            left: 0,
            width: "280px",
            backgroundColor: "#e95d4d",
            borderRight: "4px solid #e95d4d",
            padding: "1rem 1.2rem",
            boxShadow: "4px 0 8px rgba(0,0,0,0.1)",
            zIndex: 1000,
            transition: "all 0.3s ease-in-out",
          }}
        >
          <Typography
            variant="h6"
            sx={{ color: "#fff", fontWeight: "bold", fontFamily: "Pacifico" }}
          >
            Our Vision
          </Typography>
          <Typography variant="body2" sx={{ mt: 1, color: "#fff" }}>
            To leverage AI for early detection of emotional and mental disorders
            to create healthier societies.
          </Typography>

          <Typography
            variant="h6"
            sx={{ mt: 2, color: "#fff", fontWeight: "bold" }}
          >
            Our Mission
          </Typography>
          <Typography variant="body2" sx={{ mt: 1, color: "#fff" }}>
            We aim to empower individuals through awareness and access to
            cutting-edge emotion analysis tools built on deep learning.
          </Typography>
        </Box>
      )}

      {/* Content Displayed Based on Route */}
      <Container sx={{ mt: 12 }}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/signin" element={<SignIn />} />
          <Route path="/contactus" element={<ContactUS />} />
          <Route path="/aboutus" element={<About />} />
        </Routes>
      </Container>
    </div>
  );
}

export default AppLayout;
